import React from "react";
import {Link} from "react-router-dom";


const Dashboard = () => {
    return(
        <div>
            <div>
            <Link to="/home">   
				<button type="button" className="white_btn">
					Employee List
				</button>
			</Link>
            </div>
            <div>
                <h1>Welcome to Admin Page</h1>
            </div>
        </div>
    )
    
}

export default Dashboard;
